INSERT INTO `tb_article` VALUES ('1', '800种世园花卉亮相北京植物园', '目前园中可观赏紫藤花的景点共有四处，分别位于盆景园，紫藤园，宿根园以及卧佛寺。每一处景观都别具一格，分别展现了紫藤花与庭院、长廊、寺院等建筑的不同搭配，处处皆有韵味。藤花串串，仿佛是贯穿起来的珠玉，在阳光的照耀下闪闪发光、影影绰绰，与同样发光的绿色树叶相映生辉。人们漫步藤下或小憩廊中，赏花闻香，好不惬意。', '2', '2016-05-06 00:00:00', '2016-05-23 00:00:00', '/static/upload/20160428060423_19939.jpg', '转眼间，已到了紫藤花开的春末夏初。北京植物园里的紫藤花更是进入了观赏期。那一串串紫色花序，垂廊而下，构成一幅幅优美画卷，光是想象便让人心生向往。');
