INSERT INTO `tb_article` VALUES ('3', '垂垂璎珞影交加，紫藤花开邀您赏', '<p>目前园中可观赏紫藤花的景点共有四处，分别位于盆景园，紫藤园，宿根园以及卧佛寺。每一处景观都别具一格，分别展现了紫藤花与庭院、长廊、寺院等建筑的不同搭配，处处皆有韵味。藤花串串，仿佛是贯穿起来的珠玉，在阳光的照耀下闪闪发光、影影绰绰，与同样发光的绿色树叶相映生辉。人们漫步藤下或小憩廊中，赏花闻香，好不惬意。</p>', '1', '2016-05-03 20:05:47', '2016-05-03 20:05:47', '/static/upload/cover1462278298521', '繁花似锦，游人如织。4月25日—5月10日，备受期待的“走近世园花卉”——世园会花卉园艺技术集成与展示应用示范活动在北京植物园缤纷呈现。此次活动被称为“迷你世园会”,现场共分野生花卉、自育花卉、国外新优花卉3个核心展、5个精品展区，结合沿线环境布置共展出800余个花卉品种，为广大游客呈现初选的2019北京世园会新品种、新技术、新材料等。');
