INSERT INTO `tb_tiezi` VALUES ('3', '#到什么时候该做什么事#', '不是很理解“到什么时候该做什么事”这种被动逻辑。我工作是因为我想挣钱，而不是因为毕业了该工作了。我穿裙子是因为好看，而不是因为天热了该穿裙子了。我结婚是因为我有喜欢的人，而不是因为年龄到了该结婚了。没什么是该做的事，满大街爷爷奶奶人家活得好好的总不能说“到岁数了你该死了”[doge]', '2016-05-05 17:44:00', '3');
